import React from 'react';
import Recycler from '../Components/Recycler/Recycler';

class Home extends React.PureComponent {
  render() {
    let divStyle = {
      width:50 + '%',
      height: 50 + '%',
      margin: 'auto'
    }
    return (
      <div style={divStyle}>
        <Recycler />
      </div>
    )
  }
}

export default Home;
